import { reactive } from "vue";
import axios from "axios";
export default {
  name: "Mypage",
  setup() {
    const state = reactive({
      items: Object
    });
    const load = () => {
      axios.get("/api/mypage").then(({
        data
      }) => {
        state.items = data;
      });
    };
    load();
    return {
      state
    };
  }
};
